import './App.css';
import Dashboard from './pages/Dashboard';
import { BrowserRouter, Routes, Route } from 'react-router-dom';import './App.css';
import Navbar from './Components/Navbar';
import Dashboardaddvenue from './Components/Dashboard Components/Dashboardaddvenue';

function App() {
  return (
    <>
    <Navbar/>
    <BrowserRouter>
     <Routes>
        <Route path='/' element={<Dashboard/>}/>
        <Route path='/Dashboardaddvenue' element={<Dashboardaddvenue />}/>

      </Routes>
     </BrowserRouter>
    </>
  );
}

export default App;
